import React from "react";
import ReactDOM from "react-dom";
import Navbar from "./NavBar";
import HomePage from "./HomePage";

function EditPage() {
    return (
        <div>
            <Navbar></Navbar>
            <div class="form-floating mb-3">
                <input type="text" class="form-control" id="floatingInput" step="any" placeholder="name@example.com"/>
            </div>
            <div class="form-floating">
                <input type="text" class="form-control" step="any" id="floatingPassword" placeholder="Password"/>
            </div>
        </div>
    );
}

export default EditPage;
